
DROP TABLE IF EXISTS `perfumebottles`;
CREATE TABLE `perfumebottles` (
  `id` INT(11) NOT NULL,
  `base_name` VARCHAR(50) NOT NULL DEFAULT 'perfumebottle',
  `attributes` TEXT,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;



